INSERT INTO `cache_field` VALUES ('field:node:1','a:3:{s:4:\"body\";a:0:{}s:14:\"field_bp_image\";a:0:{}s:17:\"field_bp_headline\";a:0:{}}',0,1407619691,1),('field:node:10','a:3:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:961:\"<p class=\"big\">Community Radiology Associates provides patients with the highest quality radiology reports in a timely and professional manner. We provide hospitals, imaging centers and physicians with the tools they need to market their departments as the best in their area.</p>\r\n\r\n<p>We can improve care in your hospital and community by offering recommendations on your portfolio of services/modalities offered. We will set protocols, help improve efficiency, stream-line productivity, and help your department grow and expand. We cover sites that range from 1,000 studies a year to sites completing 55,000 studies a year, yet they all get the same level of service and commitment. &nbsp;Whether we are on-site or a teleradiology provider, we will run your department as if we were present daily.</p>\r\n\r\n<p class=\"quote\">\"CRA doesn\'t offer any gimmicks or special promises, just superior radiologists who still care\" <strong>Kevin Barker M.D.</strong></p>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:950:\"<p class=\"big\">Community Radiology Associates provides patients with the highest quality radiology reports in a timely and professional manner. We provide hospitals, imaging centers and physicians with the tools they need to market their departments as the best in their area.</p>\n<p>We can improve care in your hospital and community by offering recommendations on your portfolio of services/modalities offered. We will set protocols, help improve efficiency, stream-line productivity, and help your department grow and expand. We cover sites that range from 1,000 studies a year to sites completing 55,000 studies a year, yet they all get the same level of service and commitment.  Whether we are on-site or a teleradiology provider, we will run your department as if we were present daily.</p>\n<p class=\"quote\">\"CRA doesn\'t offer any gimmicks or special promises, just superior radiologists who still care\" <strong>Kevin Barker M.D.</strong></p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:14:\"field_bp_image\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:1:\"8\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:13:\"home-hero.jpg\";s:3:\"uri\";s:40:\"public://images/basic-page/home-hero.jpg\";s:8:\"filemime\";s:10:\"image/jpeg\";s:8:\"filesize\";s:6:\"155493\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1407612363\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"1208\";s:6:\"height\";s:3:\"590\";}}}s:17:\"field_bp_headline\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:25:\"Making Radiology Personal\";s:6:\"format\";N;s:10:\"safe_value\";s:25:\"Making Radiology Personal\";}}}}',0,1407619691,1),('field:node:11','a:3:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:156:\"<p>It looks like you\'re trying to access a page that requires authentication. Visit the <a href=\"/user\">login page</a> to login, and come back to try again.\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:14:\"no_filter_html\";s:10:\"safe_value\";s:156:\"<p>It looks like you\'re trying to access a page that requires authentication. Visit the <a href=\"/user\">login page</a> to login, and come back to try again.\";s:12:\"safe_summary\";s:0:\"\";}}}s:14:\"field_bp_image\";a:0:{}s:17:\"field_bp_headline\";a:0:{}}',0,1407619691,1),('field:node:12','a:3:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:156:\"<p>It looks like you\'re trying to access a page that doesn\'t exist, or has moved. Use the menu at the top of the page to find what you\'re looking for.</p>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:14:\"no_filter_html\";s:10:\"safe_value\";s:155:\"<p>It looks like you\'re trying to access a page that doesn\'t 