ame\";s:14:\"field_bp_image\";s:11:\"entity_type\";s:4:\"node\";s:6:\"bundle\";s:4:\"page\";s:7:\"deleted\";s:1:\"0\";}s:11:\"items_count\";i:0;s:13:\"array_parents\";a:2:{i:0;s:14:\"field_bp_image\";i:1;s:3:\"und\";}s:6:\"errors\";a:0:{}}}}s:13:\"process_input\";b:0;s:16:\"has_file_element\";b:1;}',1407625867,1407604267,1),('form_state_form-ikfWfxNeF75v2GykSKZkC1VOFcOjbj2KOQh2hM3rHP8','a:8:{s:10:\"build_info\";a:4:{s:4:\"args\";a:1:{i:0;O:8:\"stdClass\":28:{s:3:\"vid\";s:2:\"10\";s:3:\"uid\";s:1:\"1\";s:5:\"title\";s:14:\"Welcome to CRA\";s:3:\"log\";N;s:6:\"status\";s:1:\"1\";s:7:\"comment\";s:1:\"0\";s:7:\"promote\";s:1:\"0\";s:6:\"sticky\";s:1:\"0\";s:3:\"nid\";s:2:\"10\";s:4:\"type\";s:4:\"page\";s:8:\"language\";s:3:\"und\";s:7:\"created\";s:10:\"1407612363\";s:7:\"changed\";s:10:\"1407612363\";s:4:\"tnid\";s:1:\"0\";s:9:\"translate\";s:1:\"0\";s:18:\"revision_timestamp\";s:10:\"1407612363\";s:12:\"revision_uid\";s:1:\"1\";s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:961:\"<p class=\"big\">Community Radiology Associates provides patients with the highest quality radiology reports in a timely and professional manner. We provide hospitals, imaging centers and physicians with the tools they need to market their departments as the best in their area.</p>\r\n\r\n<p>We can improve care in your hospital and community by offering recommendations on your portfolio of services/modalities offered. We will set protocols, help improve efficiency, stream-line productivity, and help your department grow and expand. We cover sites that range from 1,000 studies a year to sites completing 55,000 studies a year, yet they all get the same level of service and commitment. &nbsp;Whether we are on-site or a teleradiology provider, we will run your department as if we were present daily.</p>\r\n\r\n<p class=\"quote\">\"CRA doesn\'t offer any gimmicks or special promises, just superior radiologists who still care\" <strong>Kevin Barker M.D.</strong></p>\r\n\";s:7:\"summary\";s:0:\"\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:950:\"<p class=\"big\">Community Radiology Associates provides patients with the highest quality radiology reports in a timely and professional manner. We provide hospitals, imaging centers and physicians with the tools they need to market their departments as the best in their area.</p>\n<p>We can improve care in your hospital and community by offering recommendations on your portfolio of services/modalities offered. We will set protocols, help improve efficiency, stream-line productivity, and help your department grow and expand. We cover sites that range from 1,000 studies a year to sites completing 55,000 studies a year, yet they all get the same level of service and commitment.  Whether we are on-site or a teleradiology provider, we will run your department as if we were present daily.</p>\n<p class=\"quote\">\"CRA doesn\'t offer any gimmicks or special promises, just superior radiologists who still care\" <strong>Kevin Barker M.D.</strong></p>\n\";s:12:\"safe_summary\";s:0:\"\";}}}s:14:\"field_bp_image\";a:1:{s:3:\"und\";a:1:{i:0;a:13:{s:3:\"fid\";s:1:\"8\";s:3:\"uid\";s:1:\"1\";s:8:\"filename\";s:13:\"home-hero.jpg\";s:3:\"uri\";s:40:\"public://images/basic-page/home-hero.jpg\";s:8:\"filemime\";s:10:\"image/jpeg\";s:8:\"filesize\";s:6:\"155493\";s:6:\"status\";s:1:\"1\";s:9:\"timestamp\";s:10:\"1407612363\";s:11:\"rdf_mapping\";a:0:{}s:3:\"alt\";s:0:\"\";s:5:\"title\";s:0:\"\";s:5:\"width\";s:4:\"1208\";s:6:\"height\";s:3:\"590\";}}}s:17:\"field_bp_headline\";a:1:{s:3:\"und\";a:1:{i:0;a:3:{s:5:\"value\";s:25:\"Making Radiology Personal\";s:6:\"format\";N;s:10:\"safe_value\";s:25:\"Making Radiology Personal\";}}}s:11:\"rdf_mapping\";a:9:{s:7:\"rdftype\";a:1:{i:0;s:13:\"foaf:Document\";}s:5:\"title\";a:1:{s:10:\"predicates\";a:1:{i:0;s:8:\"dc:title\";}}s:7:\"created\";a:3:{s:10:\"predicates\";a:2:{i:0;s:7:\"dc:date\";i:1;s:10:\"dc:created\";}s:8:\"datatype\";s:12:\"xsd:dateTime\";s:8:\"callba