INSERT INTO `field_revision_body` VALUES ('node','page',0,2,2,'und',0,'<h2>Heading Two</h2>\r\n\r\n<h3>Heading Three</h3>\r\n\r\n<h4>Heading Four</h4>\r\n\r\n<h5>Heading Five</h5>\r\n\r\n<h6>Heading Six</h6>\r\n\r\n<p>This is a bod of text, and it\'s going to be controlled by the <strong>WYSIWYG</strong> editor within <a href=\"http://drupal.org\">Drupal</a>. It\'s all styled with <em>our stylesheets</em>, so just drop it in and you\'re set. I\'m not sure if this is a long enough body, but it\'ll have to do for now.</p>\r\n\r\n<ul>\r\n	<li>Item Uno</li>\r\n	<li>Another long item that is annoying</li>\r\n	<li>Last item</li>\r\n</ul>\r\n\r\n<ol>\r\n	<li>Item Uno</li>\r\n	<li>Another long item that is annoying</li>\r\n	<li>Last item</li>\r\n</ol>\r\n\r\n<blockquote>This is a cool blockquote!</blockquote>\r\n','','full_html'),('node','page',0,10,10,'und',0,'<p class=\"big\">Community Radiology Associates provides patients with the highest quality radiology reports in a timely and professional manner. We provide hospitals, imaging centers and physicians with the tools they need to market their departments as the best in their area.</p>\r\n\r\n<p>We can improve care in your hospital and community by offering recommendations on your portfolio of services/modalities offered. We will set protocols, help improve efficiency, stream-line productivity, and help your department grow and expand. We cover sites that range from 1,000 studies a year to sites completing 55,000 studies a year, yet they all get the same level of service and commitment. &nbsp;Whether we are on-site or a teleradiology provider, we will run your department as if we were present daily.</p>\r\n\r\n<p class=\"quote\">\"CRA doesn\'t offer any gimmicks or special promises, just superior radiologists who still care\" <strong>Kevin Barker M.D.</strong></p>\r\n','','full_html'),('node','page',0,11,11,'und',0,'<p>It looks like you\'re trying to access a page that requires authentication. Visit the <a href=\"/user\">login page</a> to login, and come back to try again.','','no_filter_html'),('node','page',0,12,12,'und',0,'<p>It looks like you\'re trying to access a page that doesn\'t exist, or has moved. Use the menu at the top of the page to find what you\'re looking for.</p>\r\n','','no_filter_html'),('node','staff_member',0,13,13,'und',0,'<p>This is my bio and it\'s really long and interesting and people really must care an awful lot to even have read this far.</p>\r\n','','filtered_html'),('node','staff_member',0,14,14,'und',0,'<p>He makes things pretty and stuff, and sometimes can write a little code.</p>\r\n','','filtered_html');
/*!40000 ALTER TABLE `field_revision_body` ENABLE KEYS */;
UNLOCK TABLES;

